impl Solution {
    pub fn minimum_changes(s: String, k: i32) -> i32 {
        let n = s.len();
        let s: Vec<_> = s.chars().collect();
        let k = k as usize;

        // Calculate cost to make a substring [i..j] a semi-palindrome
        let mut cost = vec![vec![0; n]; n];
        for len in 1..=n {
            for i in 0..=n-len {
                let j = i + len - 1;
                cost[i][j] = if len == 1 { 0 } else { cost[i+1][j-1] + if s[i] == s[j] { 0 } else { 1 } };
            }
        }

        // dp[i][j] = minimum changes to partition first i characters into j parts
        let mut dp = vec![vec![i32::MAX; k + 1]; n + 1];
        dp[0][0] = 0;
        for i in 1..=n {
            for j in 1..=k.min(i) {
                for m in j-1..i {
                    dp[i][j] = dp[i][j].min(dp[m][j-1] + cost[m][i-1]);
                }
            }
        }

        dp[n][k]
    }
}
